import React from 'react'
import Vector from '../Assets/images/Vector.svg'

const NewBugs = () => {
  return (
    <div className='NewBugsBox'>
        <span className='NewBugsBox-Title'>New Bugs</span>
        <img className='NewBugsBox-Image' src={Vector}/>
    </div>
  )
}

export default NewBugs
